#
# TABLE STRUCTURE FOR: Pharmacy
#

DROP TABLE IF EXISTS `Pharmacy`;

CREATE TABLE `Pharmacy` (
  `Pharmacy_ID` int(11) NOT NULL,
  `Pharmacy_Name` varchar(255) DEFAULT NULL,
  `Pharmacy_Location` varchar(255) DEFAULT NULL,
  `Pharmacy_StreetAdress` varchar(255) DEFAULT NULL,
  `Pharmacy_City` varchar(255) DEFAULT NULL,
  `Pharmacy_ZipCode` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`Pharmacy_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



